// Sub-component for Satellites with fixed offsets from center
function SatelliteNode({ 
  position, icon, color, label, xOffset, yOffset, delay 
}: { 
  position: string, icon: React.ReactNode, color: string, label: string, xOffset: number, yOffset: number, delay: number 
}) {
  // Use a deterministic "random" duration based on position to avoid hydration mismatch
  // abs(xOffset + yOffset) provides a consistent seed per position
  const randomSeed = Math.abs(xOffset + yOffset); 
  const floatDuration = 4 + (randomSeed % 3); 

  return (
    <motion.div 
      className="absolute flex flex-col items-center group cursor-pointer z-30"
      style={{ x: xOffset, y: yOffset }}
      initial={{ opacity: 0, scale: 0 }}
      animate={{ opacity: 1, scale: 1 }}
      transition={{ 
        delay, 
        type: "spring", 
        stiffness: 100, // Reduced stiffness for softer entry
        damping: 20     // Higher damping for less oscillation
      }}
    >
      <motion.div 
        className="w-11 h-11 rounded-xl bg-[#0F1528] border border-[#1E2745] flex items-center justify-center transition-all shadow-lg relative"
        style={{  boxShadow: `0 0 0 1px ${color}20` }}
        whileHover={{ scale: 1.15, backgroundColor: '#141c36', borderColor: color }}
        animate={{ y: [0, -6, 0] }}
        transition={{ 
          duration: floatDuration, 
          repeat: Infinity, 
          ease: "easeInOut",
          delay: (randomSeed % 2) // Deterministic delay
        }}
      >
        {/* Icon Glow */}
        <div className="absolute inset-0 opacity-20 blur-md rounded-xl" style={{ backgroundColor: color }}></div>
        <div className="relative z-10">{icon}</div>
      </motion.div>
      <motion.span 
        className="mt-2 text-[10px] font-bold text-white bg-[#020410] px-2 py-1 rounded border border-[#1E2745]"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ delay: delay + 0.3 }}
      >
        {label}
      </motion.span>
    </motion.div>
  );
}

